import React, { Component } from 'react'
import {connect} from 'react-redux'

 class Computer extends Component {
    render() {
        return (
            <div className="text-center playerGame">

            <div className="think">
            <img style={{transform:'rotate(90deg)'}} className="mt-3" style={{width:100, height:100}} 
                src="./img/gameoantuxi/bua1.png" 
                alt="./img/gameoantuxi/bua1.png"/>

            </div>

            <div className="speech-bubble"></div>
            <img style={{width:150, height:150}} 
            src={this.props.co}
            alt="./img/gameoantuxi/playerComputer.png"/>
        </div>
        )
    }
}

const mapStateToProps = (state) => {
    return {
      computer: state.oanTuXiReducer.computer
    };
  };
export default connect(mapStateToProps)(Computer);
